import React, { Component } from 'react';
import UserModal from './userModal';
import UserList from './userList';

class UserIndex extends Component {
  render() {
    return (
      <div className="container">
        <UserModal />
        <UserList />
      </div>
    );
  }
}

export default UserIndex;
